import { useEffect, useState } from "react"

export default function AgentOrdreq () {
    
    let orderReqDetail

    useEffect(()=>{

        fetchdata()
    
    },[]);

    const fetchdata = async () => {
        const userDetail = sessionStorage.getItem("user")
        console.log("details ",userDetail)
        const options = {
            method : 'POST',
            headers : {
                'Content-Type' : 'application/json'
            },
            body : JSON.stringify({userDetail})
        }

        fetch('http://127.0.0.1:5000/api/Agent/Requests',options)  // API endpoint of your Flask server
        .then(response => response.json())
        .then(data => {
            console.log("data ",data)
            orderReqDetail = data
            console.log(orderReqDetail)

        })
        .catch(error => {
        console.error('Error:', error);
    });
    }

    return (
        <div>
            <h1> Delivery Requests </h1>
            <div>
            {orderReqDetail?  <>{orderReqDetail.map((items,index) => (
                <div key={index}>{items}
                </div>
            ))}</> : <>No orders</>}
            </div>
        </div>
    )
}
